class Solution:
    def removeDuplicates(self, s: str) -> str:
        stk = []
        for c in s:
            stk.append(c)
            while len(stk) > 1 and stk[-2] == stk[-1]:
                stk.pop()
                stk.pop()
        return ''.join(stk)


